import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Mainpage from './components/mainpage/Mainpage'

function App() {
  return (
    <BrowserRouter>
        <Switch>
          <Route exact path="/" component={Mainpage}/>
        </Switch>
    </BrowserRouter>

  );
}

export default App;
